INSERT INTO `askandanswers` VALUES (1,'¿Cómo compro soporte técnico de Azure?','Los planes de soporte técnico de Azure se pueden comprar en línea o a través de un contrato Enterprise. Los planes Developer, Standard o Professional Direct de este tipo están disponibles en línea a través de la página Planes de soporte técnico de Azure. Para comprar un plan de soporte técnico, debe ser el propietario de la cuenta de Microsoft Azure.\r\n\r\nSi compra Microsoft Azure a través de un contrato Enterprise (EA), puede agregar un plan de soporte técnico Standard o Professional Direct al contrato Enterprise poniéndose en contacto con su distribuidor de grandes cuentas (LAR). El soporte técnico Developer no está disponible a través de un contrato Enterprise.','¿cómo comprar soportar técnico azure ?'),(2,'¿La cuota mensual cubre un único plan de Azure o toda la cuenta?','La cuota fija mensual del soporte técnico de Azure cubre una cuenta, independientemente del número de suscripciones o de usuarios que tenga en la cuenta.\r\n\r\nTodas las suscripciones de una cuenta compartirán el mismo plan de soporte técnico y todos los usuarios con acceso de administrador o de propietario a cualquiera de las suscripciones de la cuenta con un plan de soporte técnico también tendrán derecho a recibir soporte técnico para esas suscripciones de la cuenta en concreto a las que tienen acceso.\r\n\r\nPara acceder a una cuenta de Microsoft Azure puede usar el Portal de cuentas. Desde aquí puede ver la lista de las suscripciones que pertenecen a la cuenta y que tendrán derecho a recibir soporte técnico.','¿la cuota mensual cubrir único plan azure contar ?'),(3,'¿Cuándo se me cobrará el soporte técnico de Azure?','Cuando compre un plan de soporte técnico de Azure en línea, se le cobrará inmediatamente la cuota del primer mes. Se le cobrará el importe mensual el primer día de cada ciclo de facturación. Las compras de contratos Enterprise (EA) seguirán el ciclo de facturación de los contratos.','¿cuándo cobrar soportar técnico azure ?'),(4,'¿Qué ocurre al final del período de la suscripción?','Al final del período, los planes se renovarán automáticamente en el mismo plan de soporte técnico de Azure y con el mismo método de pago.',NULL);
/*!40000 ALTER TABLE `askandanswers` ENABLE KEYS */;
UNLOCK TABLES;

